// ==UserScript==
// @name           About:Home Firefox Branding for Minefield
// @namespace      aboutHomeFirefoxBranding
// @description    Replace the Minefield branding with the Firefox branding on about:home for Firefox 4.0b11+.
// @include        about:home
// @history
// 0.1 Original script
// 
// ==/UserScript==

/*
	Important Note:
	Requires greasemonkey.aboutIsGreaseable in about:config to be set to true.
*/

var title = "Firefox Start Page";
var faviconSrc = "data:image/png;base64,";
var logoSrc = "data:image/png;base64,";

function setFavicon(src){
	// Remove previous favicon
	document.getElementById('favicon').parentNode.removeChild(document.getElementById('favicon'));
	
	// Build new favicon
    var link = document.createElement('link');
    link.type = 'image/x-icon';
    link.rel = 'icon';
    link.href = src;
    document.getElementsByTagName('head')[0].appendChild(link);
}

function setTitle(title){
	document.title = title;
}

function setLogo(src){
	document.getElementById('brandStartLogo').src = src;
}

setFavicon(faviconSrc);
setLogo(logoSrc);
setTitle(title);